import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';

import logo from './img/logo.png';
import back from './img/back1.png';
import './css/chat.css';



class chat extends Component{
    constructor(props){
        super(props);

        this.onChangeMessage = this.onChangeMessage.bind(this);

        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            message:''
        }
    }
    onChangeMessage(e){
        this.setState( {
            message: e.target.value
        });
    }
    onSubmit(e){
        e.preventDefault();
       
        const obj = {
            message : this.state.message
        };

                        axios.post('http://localhost:4000/jacklup/addchat',obj)
                        .then(res => {
                            alert("Feedback Send Successfully");
                            this.setState({
                                message:''
                    
                            })
                            console.log(res.data)});
                        window.location.replace('/chat');
                    
    }

  render() {
    return(
        <div>
            <div className='content'>

                <div className='logo'>
                    <a href = "/"><img src = {logo}/></a>
                </div>
                <br/><br/><br/><br/><br/><br/><br/>
                <div className='row'>
                    <div className='col-lg-4 left-side'>
                         
                    </div>
                    <div className='col-lg-8'>
                        <div className='outer'>
                            <form onSubmit={this.onSubmit}>
                                <div className="form-group">
                                   <textarea required  className="form-control" value={this.state.message} onChange = {this.onChangeMessage}></textarea>
                                </div>
                                <div className="form-group">
                                    <input type = "submit" value = "Submit FeedBack" className = "btn" style={{background:'purple',color:'white'}} />
                                </div>
                            </form>
                        </div>
                    </div>

                    <p style={{marginLeft:500,marginTop:50,fontWeight:'bold'}}>You Can Rate Our System <a href = "/addRating">Rating</a></p>
                </div>
            </div>
        </div>
    );
  }
}

export default chat;
